#[test]
fn run_many_blocks_proof_run() {
    let hex_str = "";
    let byte_input = hex::decode(hex_str).expect("Invalid hex");
    let mut u32_array = Vec::new();
    for i in 0..byte_input.len()/4 {
        u32_array.push(u32::from_le_bytes([byte_input[i*4], byte_input[i*4+1], byte_input[i*4+2], byte_input[i*4+3]]));
    }

    let program_path = PathBuf::from(std::env::var("CARGO_WORKSPACE_DIR").unwrap())
        .join("zksync_os")
        .join("server_app_logging_enabled.bin");

    let proof_output = zksync_os_runner::run(
        program_path,
        None,
        1 << 36,
        QuasiUARTSource::new_with_reads(u32_array),
    );

    debug!("Proof running output = 0x",);
    for word in proof_output.into_iter() {
        debug!("{word:08x}");
    }
}
